module.exports = "<img src=\"/assets/logo.png\">\n<h3>What is GCPUG?</h3>\n<p>\n  GCPUG(ジーシーパグ)はGoogle Cloud Platformを普及させることを目的とし、Googleと共にGCPをより良くし、盛り上げていくユーザーグループです。\n  私たちに共感していただける方なら、GCPUGへの参加は自由です。一緒に GCP を盛り上げていきましょう。\n</p>\n<p>\n  GCPUGはどなたでも参加できます。\n  GCPをすでにお使いの方も、これから初めようと思っている方も歓迎します。\n</p>\n<p>\n  GCPUGは物理的に集めって行うイベントとインターネット上での活動の2つがあります。\n  各地でイベントが開かれているので、支部一覧からお近くの支部を探してみてください。\n  インターネット上での活動はGoogle Group, Slack, Stackoverflowの3つがあります。\n  <a href=\"https://groups.google.com/a/gcpug.jp/forum/#!forum/users\" target=\"_blank\">Google Group</a>, <a href=\"https://docs.google.com/forms/d/1Pe2idyW79_GsYPHkON_oulC7hfzszzwWORbOi6q46uI/viewform\" target=\"_blank\">Slack</a> はだれでも参加できます。\n  特にSlackはかなり活発にやり取りが行われています。\n</p>\n<h3>ノウハウ</h3>\n<p>\n  GCPのノウハウを共有するためのリポジトリとして <a href=\"https://github.com/gcpug/nouhau\" target=\"_blank\">nouhau</a> を作成しています。\n  これからGCPを始めようと思っている方には <a href=\"https://github.com/gcpug/nouhau/tree/master/general/poem/link\" target=\"_blank\">GCP お役立ち Link集がおすすめです。</a>\n  あなたがすでにGCPを利用していてノウハウを持っている場合は、ぜひPull Requestをお願いします。\n</p>\n<h3>YouTube</h3>\n<p>\n  東京で行われたイベントのセッションを録画したものを <a href=\"https://www.youtube.com/channel/UCCw7gdgXcnxarKCEGUFELAQ\" target=\"_blank\">YouTube</a> にアップロードしています。\n  イベントの雰囲気を感じたり、過去のセッションを見ることができます。\n</p>\n<h3>SNS</h3>\n<p>\n  twitterのハッシュタグは <a href=\"https://twitter.com/hashtag/gcpug?f=tweets&vertical=default&src=hash\" target=\"_blank\">#gcpug</a> です。\n</p>\n<h3>Stackoverflow Tag</h3>\n<p>\n  GCPは <a href=\"https://cloud.google.com/support/docs/stackexchange\" target=\"_blank\">Stack Overflow</a> などのサイトにGoogleのエンジニアも参加して、質問への回答を行っています。\n  しかし、英語サイトしかサポートしていないため、日本語の質問はなるべくコミュニティで回答するようにしています。\n  現状、コミュニティがサポートしているのは、 <a href=\"https://ja.stackoverflow.com/\" target=\"_blank\">日本語版Stack Overflow</a> です。\n  GCP公式と同じタグをサポートをしています。\n</p>\n<ul>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-platform\" target=\"_blank\">Google Cloud Platform</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-app-engine\" target=\"_blank\">Google App Engine</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/app-engine-flexible\" target=\"_blank\">Google App Engine Flex</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-compute-engine\" target=\"_blank\">Google Compute Engine</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-container-engine\" target=\"_blank\">Google Kubernetes Engine</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-storage\" target=\"_blank\">Google Cloud Storage</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-bigtable\" target=\"_blank\">Google Cloud Bigtable</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-datastore\" target=\"_blank\">Google Cloud Datastore</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-bigquery\" target=\"_blank\">BigQuery</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-dataflow\" target=\"_blank\">Google Cloud Dataflow</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-dataproc\" target=\"_blank\">Google Cloud Dataproc</a></li>\n  <li><a href=\"https://ja.stackoverflow.com/questions/tagged/google-cloud-pubsub\" target=\"_blank\">Google Cloud Pub/Sub</a></li>\n</ul>\n<h3>禁止事項</h3>\n<p>\n  GCPUGはGCPのナレッジの共有を目的としたコミュニティです。\n</p>\n<ul>\n  <li>他社批判をしない（比較はWelcome）</li>\n  <li>お金儲けに使わない</li>\n  <li>誹謗中傷をしない</li>\n  <li>迷惑行為をしない</li>\n  <li>内輪ネタにしない</li>\n  <li>来るものを拒まない</li>\n  <li>押し売りをしない</li>\n</ul>\n"

